Object.defineProperty(rewa, "setData", {
  value: function (e) {
    for (key in e) {
      this.data[key] = e[key]
      if (key == 'list') {
        z(e[key])
        let html = ''
        for (let i = 0; i < e[key].length; i++) {
          let ulli = ''
          let title = e[key][i]
          for (let map in title.pages) {
            ulli += '<li class="list_li">' 
            + map + '<span class="right"><span class="n">' 
            + title.pages[map].n
            +`</span><img src="../img/ta1.png" class="tar"  onclick="app.target('`+map+`')"></img>
            <img src="../img/ta2.png" class="tar`
            +(title.pages[map].finished?'':' gray')+`"></img>` + '</span>'+'</li>'
          }
          html += `<dt class="list_dt"> <span class="_after"></span>
        <p>`+ title.name + '<span class="right"><span class="n">' 
        + title.n
        +`</span><img src="../img/ta1.png" class="tar"  onclick="app.targets(2)"></img>
        <img src="../img/ta2.png" class="tar`
        +(title.finished?'':' gray')+`"></img></p>
        <i class="list_dt_icon"></i>
      </dt>
      <dd class="list_dd">
      <ul>
        `+ ulli + `
      </ul>
    </dd>
`
        }
        $('.list_dl').html(html)
        $(".list_dt").on("click", function () {
          $('.list_dd').stop();
          $(this).siblings("dt").removeAttr("id");
          if ($(this).attr("id") == "open") {
            $(this).removeAttr("id").siblings("dd").slideUp();
          } else {
            $(this).attr("id", "open").next().slideDown().siblings("dd").slideUp();
          }
        });
      }
    }
  }
})
