function loadlist() {
  if (!app.reward) {
    z('wait')
    setTimeout(() => {
      loadlist()
    }, 1200);
    return
  }
  let guess
  let cate
  switch (Number(sg)) {
    case 1:
      guess = 0
      break;
    case 2:
      guess = 1
      break;
    case 3:
      guess = 2
      break;
    case 4:
      guess = 11
      break;
    default:
      guess = 10
      break;
  }
  switch (Number(sc)) {
    case 0:
      cate = app.get('starreward') || []
      break;
    case 1:
      cate = undevable
      break;
    case 2:
      cate = devable
      break;
    case 3:
      cate = use
      break;
    case 4:
      cate = fntr
      break;
    case 5:
      cate = ship
      break;
    case 6:
      cate = cated
      break;
    case 7:
      cate = 'all'
      break;
  }
  z(app.reward[guess], cate)
  list = []
  for (let keys in app.reward[guess]) {
    let pages = app.reward[guess][keys]
    let page = {}
    let finished = true
    let sum = 0
    for (let key in pages) {
      let fnshd = app.data[app.wktoi[key]].guess == 2
      sum += pages[key]
      page[key] = {
        n: pages[key],
        // star:app.get('starwk').indexOf(key)>-1,
        finished: fnshd
      }
      if (!fnshd) finished = false;
    }
    if (cate != cated ? cate.indexOf(keys) > -1 : cate.indexOf(keys) == -1) {
      list.push({
        name: keys,
        n: sum,
        star: app.get('starreward').indexOf(keys) > -1,
        finished: finished,
        open: false,
        pages: page
      })
    }
  }
  rewa.setData({
    list: list
  })
  z(list)
}